export default errorTypeFunc = (errorCode) => {
  switch (errorCode) {
    case 401:
      return 'NOT_AUTHORIZED_ERROR';
    case 500:
      return 'VALIDATION_ERROR';
    case 501:
      return 'NOT_FOUND_ERROR';
  }
};
